%[text] # Using uDALES utilities in MATLAB
%[text] This tutorial demonstrates how to use the uDALES MATLAB utilities for post-processing simulation data. It covers 1) merging short-term time-averaged data to long-term averages, and 2) coarse-graining fields for Spatial filtering (coarse-graining method). The utility functions include:
%[text] - [**merge\_stat**](internal:M_6c19)**.** This method merges the short-term time average and (co)variance into long-term averages and associated (co)variance.
%[text] - [**coarsegrain\_field**](internal:M_9e57)**.** This method allows you to coarse-grain a field using a planar filter in the x-y plane using a fixed lengthscale \[1\]. \
%[text] ## Initialise udbase and load data
% preamble
clear variables
close all

% add the uDALES matlab path
% addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')
addpath('E:\uDALES\u-dales-enhance-udbase-udgeom-integration\tools\matlab')

% create an instance of the udbase class
expnr = 110;  % Experiment number (corresponds to namoptions.110)
expdir = 'E:\uDALES\jh6016c\work\110';

sim = udbase(expnr, expdir); %[output:59950a79]
%%
%[text] %[text:anchor:M_6c19] ## Combine short-term time average into a long-term time average 
%[text] uDALES statistics are collected over fixed time-windows. Sometimes these time windows may be a bit too short. The functions `merge_stat_var` and `merge_stat_cov` are able to combine several of time-windows into larger ones. 
%[text] Let's start with loading short-term time-averaged data, for example the 1-D plane average
uxyt = sim.load_stat_xyt('uxyt');        % u-velocity profile (z) [m/s]
wxyt = sim.load_stat_xyt('wxyt');        % w-velocity profile [m/s]
upupxyt = sim.load_stat_xyt('upuptxyc'); % u-velocity variance [m²/s²]
upwpxyt = sim.load_stat_xyt('upwpxyt');  % u-w velocity covariance [m²/s²]
time = sim.load_stat_xyt('time');        % Time coordinate for xyt data [s]
%[text] Check the averaging time interval
time %[output:54f0a593]
length(time) %[output:04448c51]
%[text] So there are three time-averaging intervals. Long-term time averaging can be used by using
help merge_stat %[text:anchor:M_348c] %[output:39dd8d5a]
%[text] This function needs all the short-term variables related as the input, plus a average time window. The long-term average is simply the average of the short-term averages, but the long-terms variance  contains both contribution from variance in the short-term mean and the short term variance. 
%[text] Let's start with the full version of `merge_stat`, obtaining long-term quantities for $\\overline u$, $\\overline{w}${"editStyle":"visual"} and their covariance $\\overline{u'w'}$ over all three time segments:
Nwindow = length(time);

% input all the short-term variables related
[uxyt_longterm, wxyt_longterm, upwpxyt_longterm] = merge_stat(uxyt, wxyt, upwpxyt, Nwindow);
%[text] if you only need the long-term quantities for $\\overline u$ and $\\overline{u'u'}$ over all time, you can reduce it to:
[uxyt_longterm, upupxyt_longterm] = merge_stat(uxyt, upupxyt, Nwindow);
%[text] further, if you simply need a long-term time-averaged $\\overline u$ over all time, simply use:
uxyt_longterm = merge_stat(uxyt, Nwindow);
%[text] Let's check the dimension of the short-term and long-term statistics
size(uxyt) %[output:57eaebf5]
size(uxyt_longterm) %[output:243e373b]
%[text] If you want an average over shorter window, you can the last input, for example, `Nwindow`:
Nwindow = 2;
[uxyt_longterm, upupxyt_longterm] = merge_stat(uxyt, upupxyt, Nwindow);

size(uxyt_longterm) %[output:6dad3f96]
%[text] There were three intervals, and the last two were used to average over. The first time-interval has been discarded.
%%
%[text] %[text:anchor:M_9e57] ## Coarse-graining 3D fields
%[text] We recently developed a coarse-graining method that is computationally efficient and can be used to coarse-grain data \[1\]. In order to demonstrate its use, let's load some three-dimensional uDALES data.
ut = sim.load_stat_t('ut'); % load 3D field
%[text] The coarse-graining method is has the following syntax:
help coarsegrain_field %[output:2a1766a7]
%[text] The routine takes in multiple filter lengths simultaneously.
filter_lengths = [8, 32, 128];  % Filter widths in meters

% filter the last field
u_filtered = coarsegrain_field(ut(:,:,:,end), filter_lengths, sim.xm, sim.ym); %[output:94ba948b]
% Create figure with subplots comparing original and filtered fields

figure %[output:52455409]
k_level = 10;
% Original field (unfiltered)
subplot(2,2,1) %[output:52455409]
pcolor(sim.xt, sim.yt, ut(:,:,k_level)');  %[output:52455409]
shading flat; axis equal tight; colorbar;  %[output:52455409]
clim([-1 2]) %[output:52455409]
title('Original Field (Unfiltered)') %[output:52455409]
xlabel('x [m]'); ylabel('y [m]'); %[output:52455409]

% Filtered fields with increasing filter lengths
filter_titles = {
    sprintf('Filter Length = %.0f m', filter_lengths(1)),
    sprintf('Filter Length = %.0f m', filter_lengths(2)), 
    sprintf('Filter Length = %.0f m', filter_lengths(3))
};

for i = 1:3 %[output:group:9f10ed38]
    subplot(2,2,i+1) %[output:52455409]
    pcolor(sim.xt, sim.yt, u_filtered(:,:,k_level,i)'); 
    shading flat; axis equal tight; colorbar; 
    clim([-1 2])
    title(filter_titles{i})
    xlabel('x [m]'); ylabel('y [m]');
end %[output:group:9f10ed38]
%%
%[text] ## References
%[text] \[1\] Maarten van Reeuwijk, Jingzi Huang (2025) Multi-scale Analysis of Flow over Heterogeneous Urban Environments, *Bound-Lay. Met.* **191**, 47.

